import React from "react";
import "./Home.css";
import HomeOutlinedIcon from "@mui/icons-material/HomeOutlined";
import LogoutIcon from "@mui/icons-material/Logout";
import TagIcon from "@mui/icons-material/Tag";
import NotificationAddIcon from "@mui/icons-material/NotificationAdd";
import PeopleAltOutlinedIcon from "@mui/icons-material/PeopleAltOutlined";
import BookmarksOutlinedIcon from "@mui/icons-material/BookmarksOutlined";

function Home() {
  return (
    <>
      <section className="home-main-section">
        <section className="Left-section">
          <div>
            <HomeOutlinedIcon sx={{ fontSize: 40 }} />
            Home
          </div>
          <div>
            <TagIcon sx={{ fontSize: 40 }} />
            Explore
          </div>
          <div>
            <NotificationAddIcon sx={{ fontSize: 40 }} />
            Notification
          </div>
          <div>
            <PeopleAltOutlinedIcon sx={{ fontSize: 40 }} />
            Profile
          </div>
          <div>
            <BookmarksOutlinedIcon sx={{ fontSize: 40 }} /> Bookamrks
          </div>
          <div>
            <LogoutIcon sx={{ fontSize: 40 }} />
            hello
          </div>
        </section>
        <section className="middle-section">hello</section>
        <section className="right-section">hello</section>
      </section>
    </>
  );
}

export default Home;
